import logo from './logo.svg';
import './App.css';
import Container from '@material-ui/core/Container';


function App() {
  return (
    <div className="App">
      <div className="App-body">

        <Container maxWidth="md">
        <div className="new-task"></div>
        <div className="todo-list"></div>
        </Container>
      </div>

    </div>
  );
}

export default App;
